import './App.css';
import {useState, useEffect} from 'react'
import Axios from 'axios'

function App() {
  const [displayData, setDisplayData] = useState([])

  useEffect(()=>{
    Axios.get("http://localhost:3001/gp").then((data)=>{
      setDisplayData(data)
    })
  }, [])

  return (
    <div className='app'>
      <div className='diplay'>
        {displayData.map((elem)=>{
          return(
            <>
              <h1>{elem.name}</h1>
              <p>{elem.age}</p>
              <p>{elem.username}</p>
            </>
          )
        })}
      </div>
    </div>
  );
}

export default App;
